import React from 'react';
import { Carousel, Button } from 'react-bootstrap';
import '../styles/MainBanner.css';
import dog1 from '../images/dog1.jpg';
import dog2 from '../images/dog2.jpg';

const MainBanner = () => {
  return (
    <div className="main-banner-container">
      {/* First Carousel */}
      <Carousel className="carousel-top">
        {/* Carousel items for the first carousel */}
        {/* ... */}
      </Carousel>

      {/* Optionally, you can include some spacing between the two carousels */}
      <div className="carousel-spacing"></div>

      {/* Second Carousel */}
      <Carousel className="carousel-bottom">
        {/* Carousel items for the second carousel */}
        {/* ... */}
      </Carousel>
    </div>
  );
};

export default MainBanner;
